import './App.css';

const list = ["Batu","Emre","Emir","Umut","Semih","Ömer","Arda"]
let count = 0

function ListWriter(){
  return(list.map((name =>
    <li>{name}</li>)));
}

count = 0
function CountButton(){
  count++;
  <section>count</section>
}

function App() {
  return(<div>
  <p>HELLO WORLD</p>
  <section>{<ul>{ListWriter()}</ul>}</section>
  <p>Counter</p>
  <button onClick={CountButton()}></button>
  </div>)
}

export default App;
